import React from 'react';
import { useNavigate } from 'react-router-dom';
import { FadeIn } from '../common/Animations';

interface GameResultsProps {
  result: {
    winner?: string;
    score?: number;
    forfeitedBy?: string;
    error?: string;
    stats?: {
      player1Correct: boolean;
      player2Correct: boolean;
      duration: number;
      messageCount: number;
      pointBreakdown?: {
        correctGuess?: number;
        fooledOpponent?: number;
        speedBonus?: number;
      }
    };
  };
  onPlayAgain: () => void;
}

const GameResults: React.FC<GameResultsProps> = ({ result, onPlayAgain }) => {
  const navigate = useNavigate();

  const renderPointBreakdown = () => {
    if (!result.stats?.pointBreakdown) return null;
    const { correctGuess, fooledOpponent, speedBonus } = result.stats.pointBreakdown;

    return (
      <div className="space-y-2 text-sm">
        {correctGuess && (
          <div className="flex justify-between">
            <span>Correct Guess</span>
            <span className="text-game-success">+{correctGuess}</span>
          </div>
        )}
        {fooledOpponent && (
          <div className="flex justify-between">
            <span>Fooled Opponent</span>
            <span className="text-game-success">+{fooledOpponent}</span>
          </div>
        )}
        {speedBonus && (
          <div className="flex justify-between">
            <span>Speed Bonus</span>
            <span className="text-game-success">+{speedBonus}</span>
          </div>
        )}
      </div>
    );
  };

  if (result.error) {
    return (
      <div className="fixed inset-0 bg-black/50 flex items-center justify-center z-50">
        <FadeIn>
          <div className="bg-game-dark-800 rounded-lg p-6 max-w-md w-full mx-4">
            <h3 className="text-xl font-bold mb-4 text-game-light">Game Ended</h3>
            <p className="text-game-light-600 mb-6">{result.error}</p>
            <div className="flex justify-end space-x-4">
              <button onClick={() => navigate('/')} className="btn btn-secondary">
                Home
              </button>
              <button onClick={onPlayAgain} className="btn btn-primary">
                Play Again
              </button>
            </div>
          </div>
        </FadeIn>
      </div>
    );
  }

  return (
    <div className="fixed inset-0 bg-black/50 flex items-center justify-center z-50">
      <FadeIn>
        <div className="bg-game-dark-800 rounded-lg p-8 max-w-md w-full mx-4">
          <div className="text-center mb-8">
            <div className="text-5xl mb-4">
              {result.score ? 'ðŸŽ‰' : 'ðŸ˜…'}
            </div>
            <h3 className="text-2xl font-bold text-game-light mb-2">
              {result.score ? 'Victory!' : 'Good Try!'}
            </h3>
            {result.score ? (
              <div className="text-game-success text-3xl font-bold">
                +{result.score} points
              </div>
            ) : (
              <p className="text-game-light-600">Better luck next time!</p>
            )}
          </div>

          <div className="space-y-6 mb-8">
            {/* Point Breakdown */}
            {result.score && (
              <div className="bg-game-dark-700 p-4 rounded-lg">
                <h4 className="text-game-light font-semibold mb-3">Point Breakdown</h4>
                {renderPointBreakdown()}
              </div>
            )}

            {/* Game Stats */}
            {result.stats && (
              <div className="bg-game-dark-700 p-4 rounded-lg">
                <h4 className="text-game-light font-semibold mb-3">Game Stats</h4>
                <div className="grid grid-cols-2 gap-4">
                  <div className="text-center p-3 bg-game-dark-600 rounded">
                    <div className="text-xl font-bold text-game-light">
                      {Math.floor(result.stats.duration / 60)}:{(result.stats.duration % 60).toString().padStart(2, '0')}
                    </div>
                    <div className="text-sm text-game-light-600">Duration</div>
                  </div>
                  <div className="text-center p-3 bg-game-dark-600 rounded">
                    <div className="text-xl font-bold text-game-light">
                      {result.stats.messageCount}
                    </div>
                    <div className="text-sm text-game-light-600">Messages</div>
                  </div>
                </div>
              </div>
            )}
          </div>

          <div className="flex justify-end space-x-4">
            <button 
              onClick={() => navigate('/')} 
              className="px-4 py-2 bg-game-dark-600 text-game-light rounded hover:bg-game-dark-500 transition-colors"
            >
              Home
            </button>
            <button 
              onClick={onPlayAgain} 
              className="px-4 py-2 bg-game-primary text-white rounded hover:bg-game-primary-dark transition-colors"
            >
              Play Again
            </button>
          </div>
        </div>
      </FadeIn>
    </div>
  );
};

export default GameResults;
